{"map": [[43.65049713558581, -79.44499101419677]], "picture": null, "comments": "Hello, it would be awesome if we could get bike parking posts installed on the sidewalk in front of 383 Sorauren Avenue.

There's a ton of room there so I imagine you could fit at least four parking posts there!

Thank you!", "happening": [{"date": "2018-06-29T15:09:50.000Z", "time": ["hours"]}], "problem_type": ["absent"]}

{"map": [[43.6580617, -79.3864974]], "picture": null, "comments": "There really should be more bike stands around the hospitals.  Every time I go to TGH I have difficulty finding a parking space so have to tie up to a lamp post or something else.

Also on St. Clair by Winona, the TD Bank used to have more than one parking  space but since the new TTC has been put back, only one bike space is there and it is usually full.

", "happening": [{"date": "2018-07-13T20:21:30.000Z", "time": ["hours"]}], "problem_type": ["absent"]}

{"map": [[43.6580617, -79.3864974]], "picture": null, "comments": "Your map does not work; it does not allow me to add/identify a place to/on it!  

There is a DAMAGED ring/post bike parking pole on Church Street, west side immediately north of King St E.  It has no RING.

Your app also does not work on Edge browser,  it did not allow me to select type of problem. I am now using Chrome.", "happening": [{"date": "2018-07-25T13:22:22.000Z", "time": ["minutes"]}], "problem_type": ["damaged"]}

{"map": [[43.73620230354532, -79.39408690022128]], "picture": null, "comments": "Why don’t bike shoes have spikes?  Really?   Just smashed a killer ride over to the Golf Course, bag on back, and off we go!   Got through 8 holes but ran into a water hazard on 9 but CAN’T LOCK MY BIKE!!!!

Wouldn’t a few short, solid, steel, posts be a great idea around the fairways?

PS.  We need more spandex in Golf!!  ", "happening": [{"date": "2018-07-28T15:53:10.000Z", "time": ["minutes"]}], "problem_type": ["absent", "other"]}

{"map": [[43.6580617, -79.3864974]], "picture": null, "comments": "Bike parking around scotiabank theatre is always impossible. Lots of room for more racks on Widmer.

Especially during TIFF, it's really hard to find parking near both Scotia and Tiff Lightbox cinemas.

Thanks! ", "happening": [{"date": "2018-07-29T00:37:00.000Z", "time": ["hours"]}], "problem_type": ["full"]}

{"map": [[43.68842153702503, -79.39405360747116]], "picture": null, "comments": "After recent renovations at 2 St Clair Ave E (both exterior and interior), all previous bicycle rings have been replaced with the vertical post system that appears to be the latest update by the City of Toronto.

Unfortunately, the implementation of this new post has been short-sighted as it precludes cyclist's using a mini-Ulock from securing their bike. The vertical posts are simply too wide to accomodate smaller locks. It can even be challenging for those with a medium size lock to secure their bike in a desired configuration.

Is it possible to have some additional ring and posts added to the corner of Yonge and St Clair?", "happening": [{"date": "2018-09-10T03:17:48.000Z", "time": ["hours"]}], "problem_type": ["other"]}

{"map": [[43.65615634963522, -79.40993378846201]], "comments": "Bike rink not bolted on at top of ring

Abandoned bike left on ring. 
", "happening": [{"date": "2018-07-31T14:52:05.000Z", "time": ["hours"]}], "problem_type": ["damaged", "badly"]}
